- input: "TEXT\x1CC00041269\x1CX0\x1C\x1CF3XA\x1CThis amendment is in response to
    the Commission?s letter dated April 8, 2008, concerning the Committee?s February
    Monthly Report.  The excessive contributions from Donna Curling and Douglas Curling
    were transferred to the Committee?s Non-Federal Account on January 30, 2008.  A
    note has been included with the transfer referencing this and a negative MEMO
    Schedule A has been included showing the true year-to-date totals for these two
    contributors. The two misdeposited contributions were from Jean McRae and Stephen
    Leeds.  There is now a negative MEMO Schedule A for these contributions.  The
    transfers to the Non-Federal Account for ?Payroll Fees? and ?Ted Terry Bonus?
    have been corrected.  The report has been amended to reflect the actual disbursements
    to Paychex for Payroll Service Fees and Ted Terry for a Payroll Bonus.  The ?Jefferson
    Jackson Dinner/Jan. 30, 2008,? ratio reported on the Schedule H2 was correct.
    However, the filing software used the incorrect ratio. This has been corrected
    on the amendment. The payment for ?Polling? on Schedule H4 was for general message
    development for the Committee and was not for the benefit of any candidate for
    federal office.   The payment for ?Events? on Schedule H4 was for Room Rental
    to tape a response to the GA State of the State address. The  payment to Lake
    Research Partners for ?Consulting Expenses? was for expenses incurred by the vendor
    while conducting general message development consulting. The payment to Mother?s
    Finest Catering for ?Event Catering? was for a donor maintenance event with former
    Governor Roy Barnes. It did not benefit any candidate for federal office. Payments
    for ?Payroll? and ?Payroll Taxes? on Schedule H4 are for employees who did not
    spend more than 25% of their time during the period on activities in connection
    with a federal election.   "
